import "./Sidemenu.scss";
import { Link } from 'react-router-dom';
import { FaBlackberry } from "react-icons/fa";

function Sidemenu(props) {
  console.log(props);

  return (
    <ul className="side-menu">
      <Link  to="/">
        <li>About</li>
      </Link>
      <Link  to="/tech">
        <li>Technologies</li>
      </Link>
       <Link  to="/projects">
        <li>Projects</li>
      </Link>

    </ul>
  );
}

export default Sidemenu;
